import Map from "./Map";
import { YMaps } from '@pbe/react-yandex-maps';


export function ModalMaps({setShowModal}){


    return <div>
        <div className={'bg-black/50 fixed left-0 top-0 right-0 bottom-0 z-20 cursor-default'} onClick={()=>setShowModal(false)}></div>
        <div className={'bg-white w-[1000px] h-[650px] rounded-xl fixed top-[5%] left-[50%] translate-x-[-50%] shadow-2xl z-30 cursor-default'}>
            <div className={'w-10 h-10 bg-black'}>
                <YMaps>
                    
                </YMaps>
            </div>
        </div>

    </div>
}
